import React from 'react'
import LogTable from '../../../_components/_virtualized/_table/Table';
import { AutoSizer, Index } from 'react-virtualized';
import TableColunm from '../../../_components/_virtualized/_table/TableColunm';
import { Grid } from '@material-ui/core';
import { ILogmessageRow } from './interfaces/ILogMessageRow';
import TableCell from '../../../_components/_virtualized/_table/TableCell';
import { useDispatch } from 'react-redux';
import { SetPageTitle } from '../../../_redux/_appStateStore/appStoreAccessor';
import { ILogMessageTableState } from './loggingDataService';

interface IProps{
    logmessages: ILogmessageRow[]
    selectedItems: ILogMessageTableState
    handleSelectedItems: (items: number[]) => void
    handleSelectAll: () => void
}

const LoggingPageContainer: React.FC<IProps> = (props) =>{

    const {logmessages, selectedItems, handleSelectedItems, handleSelectAll} = props

    const dispatch = useDispatch();

    dispatch(SetPageTitle("Administration - Logging"))
  
    const rowGetter = React.useCallback((row: Index) =>{
        return logmessages[row.index]
    },[logmessages])

    const cellRenderer = React.useCallback((cellData: any, dataKey: string, index: number) =>{
        return(
            <TableCell id={logmessages[index].id} value={cellData} selectedItems={selectedItems.ids} hasCheckbox={dataKey==='id'} handleSelectedItems={handleSelectedItems} />
        )
    },[selectedItems, logmessages, handleSelectedItems])

    return(
        <Grid container>
            <AutoSizer disableHeight>
                {({width}) =>(
                <LogTable 
                    height={800} 
                    width={width} 
                    rowHeight={50} 
                    rowCount={logmessages.length} 
                    headerHeight={100}
                    logmessages={logmessages}
                    getRow={rowGetter}
                    >
                    {TableColunm({key: "0", dataKey: 'id', width: 150, headerValue:"ID", allselected: selectedItems.length === logmessages.length,  customCellRenderer: cellRenderer, handleSelectAll: handleSelectAll })}
                    {TableColunm({key: "1", dataKey: 'timeStamp', width: 300, headerValue: "Date", allselected: selectedItems.length === logmessages.length, customCellRenderer: cellRenderer, handleSelectAll: handleSelectAll})}
                    {TableColunm({key: "2", dataKey: 'messageType', width: 300, headerValue: "Type", allselected: selectedItems.length === logmessages.length, customCellRenderer: cellRenderer, handleSelectAll: handleSelectAll})}
                    {TableColunm({key: "3", dataKey: 'message', width: 500, headerValue: "Message", allselected: selectedItems.length === logmessages.length, customCellRenderer: cellRenderer, handleSelectAll: handleSelectAll})}
                    {TableColunm({key: "4", dataKey: 'exception', width: 500, headerValue: "Exception", allselected: selectedItems.length === logmessages.length, customCellRenderer: cellRenderer, handleSelectAll: handleSelectAll})}
                </LogTable>
            )}
            </AutoSizer>
        </Grid>
    )
}

export default LoggingPageContainer
